use std::collections::HashSet;

fn main() {
    let asd = "";

    let chars: Vec<char> = asd.chars().collect();
    let l = chars.len(); // 1198
    let message_size = 14;
    'outer: for i in 0..l {
        if i < message_size {
            continue;
        }
        let mut s = HashSet::new();
        for j in 0..message_size {
            if !s.insert(chars[i-j]) {
                continue 'outer;
            }
        }

        println!("{}", i + 1);
        break;
    }
}
